import React from 'react';
import {useState} from 'react';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import MainImg from './Komponenty/HlavnaStranka/MainImg';
import TopBar from "./Komponenty/HlavnaStranka/TopBar";
import DestinaciaDropDown from './Komponenty/HlavnaStranka/DestinaciaDropDown';

const HlavnaStranka = () => {
    const [selected, setSelected] = useState("Vybrat estináciu");
    return (
        <Router>
            <Routes>
                <Route path="/vyhladavanie" element={<MainImg />} />
                <Route path="/info" element={<TopBar />} />
                <Route path="/" element={<>
                    <TopBar />
                    <MainImg />
                    <DestinaciaDropDown  selected={selected} setSelected={setSelected}/>
                </>} />

            </Routes>
        </Router>
    );
};

export default HlavnaStranka;
